 const showReducer = (state = {}, action) => {
    if (action.type === 'ADD_SHOW') {
        state = {
            ...state,
            ...action.showName
        }
        console.log(state);
        return {
            ...state,
            ...action.showName
        }
    }
    return state;
}

export default showReducer;
